import React, { useEffect } from 'react'
import axiosInstance from '../../baseurl'

function Docchat() {
    useEffect(()=>{
        axiosInstance.post(`/viewCustomersforDr/${localStorage.getItem('Doctorlogid')}`)
        .then((res)=>{console.log(res);})
        .catch((err)=>{console.log(err);})
    },[])
  return (
    <div className='container-top'>Docchat</div>
  )
}

export default Docchat
